import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container pt-3">
      <div className="row">
          <div className="col">
              form
          </div>
      </div>
        <div className="row">
            <div className="col">
                post
            </div>
            <div className="col">
                fetched col
            </div>
        </div>
    </div>
  );
}

export default App;
